import React, { Component } from "react";
import { Button, AppBar, Input, Container, Avatar } from "@material-ui/core";

class Header extends Component {
  render() {
    return (
      <div>
        <AppBar position="static" color="secondary">
          <Avatar src="../" />
          <Button fullWidth="false">Home</Button>
          <Button fullWidth="false">Contact</Button>
          <Button fullWidth="false">About</Button>
        </AppBar>
        <Container>
          <Button variant="contained" color="primary">
            Hello World
          </Button>
          <Input fullWidth="true" />
        </Container>
      </div>
    );
  }
}

export default Header;
